//日志组件
import LogItem from "./LogItem";
import "./Logs.css";
import Card from "../UI/Card/Card";
const Logs = (props) => {
  const logsData = props.logsData.map((item) => (
    <LogItem
      data={item}
      key={item.id}
      onDeleteLog={() => props.onDeleteLog(item.id)}
    />
  ));
  return (
    <Card className="logs">
      {props.logsData.length === 0 ? <p>无学习记录</p> : logsData}
    </Card>
  );
};
export default Logs;
